import React from 'react'

function MainAbout() {
  return (
    <div className="MainAbout">

        <h3>About Me</h3>
        <p>Something things that I like about Coding and my professional credentials</p>

        <h3>James Carr</h3>
        <p>Here is some text about things I like to do</p>

    </div>
  );
}

export default MainAbout;
